HS Code Description:
Pigs', hogs' or boars' bristles and hair;
badger hair and other brush making hair;
waste of such bristles or hair.

Ambergris, castoreum, civet and musk;
cantharides; bile, whether or not dried;
glands and other animal products used in the
preparation of pharmaceutical products,
fresh, chilled, frozen or otherwise
provisionally preserved.

Broad beans (Vicia faba var. major) and horse
beans(Vicia faba var. equina, Vicia faba
var.minor)

Hop cones, fresh or dried, whether or not
ground, powdered or in the form of pellets;
lupulin.

Tapioca and substitutes therefor prepared
from starch, in the form of flakes, grains,
pearls, siftings or in similar forms.

Other manufactured tobacco and
manufactured tobacco substitutes;
"homogenised" or "reconstituted" tobacco;
tobacco extracts and essences.

Diphosphorus pentaoxide; phosphoric acid;
polyphosphoric acids, whether or not
chemically defined.

Hydroxide and peroxide of magnesium;
oxides, hydroxides and peroxides, of
strontium or barium.

Artificial corundum, whether or not
chemically defined; aluminium oxide;
aluminium hydroxide.

Chlorides, chloride oxides and chloride
hydroxides; bromides and bromide oxides;
iodides and iodide oxides.

Isotopes other than those of heading 28.44;
compounds, inorganic or organic, of such
isotopes, whether or not chemically defined.

HS Code:
Notes.
1.- This Chapter does not cover:
(a) Foods or beverages (such as dietetic, diabetic or fortified foods, food
supplements, tonic beverages and mineral waters), other than
nutritional preparations for intravenous administration (Section IV);
(b) Preparations, such as tablets, chewing gum or patches (transdermal
systems), intended to assist smokers to stop smoking (heading 21.06
or 38.24)
(c) Plasters specially calcined or finely ground for use in dentistry
(heading 25.20);
(d) Aqueous distillates or aqueous solutions of essential oils,suitable for
medicinal uses(heading 33.01);
(e) Preparations of headings 33.03 to 33.07, even if they have therapeutic
or prophylactic properties;
(f) Soap or other products of heading 34.01 containing added
medicaments;

HS Code Description:
Pickling preparations for metal surfaces;
soldering brazing or welding powders and pastes
consisting of metal and other materials

Retreaded or used pneumatic tyres of rubber;
solid or cushion tyres, tyre treads and tyre
flaps, of rubber.

HS Code:
Notes.
1.- This Section does not cover:
(a) Animal brush making bristles or hair (heading 05.02); horsehair or
horsehair waste (heading 05.11);
(b) Human hair or articles of human hair (heading 05.01, 67.03 or 67.04),
except straining cloth of a kind commonly used in oil presses or the
like (heading 59.11);
(c) Cotton linters or other vegetable materials of Chapter 14;
(d) Asbestos of heading 25.24 or articles of asbestos or other products of
heading 68.12 or 68.13;
(e) Articles of heading 30.05 or 30.06; yarn used to clean between the
teeth (dental floss), in individual retail packages, of heading 33.06
(f) Sensitised textiles of headings 37.01 to 37.04;
(g) Monofilament of which any cross-sectional dimension exceeds 1 mm
or strip or the like (for example, artificial straw) of an apparent width
exceeding 5 mm, of plastics (Chapter 39), or plaits or fabrics or other
basketware or wickerwork of such monofilament or strip (Chapter 46);

HS Code Description:
Knotted netting of twine, cordage or rope;
made up fishing nets and other made up nets,
of textile materials.

Tarpaulins, awnings and sunblinds; tents;
sails for boats, sailboards or landcraft,
camping goods.

HS Code:
Notes.
1.- This Chapter does not cover:
(a) Disposable foot or shoe coverings of flimsy material (for example,
paper, sheeting of plastics) without applied soles. These products are
classified according to their constituent material;
(b) Footwear of textile material, without an outer sole glued, sewn or
otherwise affixed or applied to the upper (Section XI);
(c) Worn footwear of heading 63.09;
(d) Articles of asbestos (heading 68.12);
(e) Orthopaedic footwear or other orthopaedic appliances, or parts thereof
(heading 90.21); or
(f) Toy footwear or skating boots with ice or roller skates attached; shin-
guards or similar protective sportswear (Chapter 95).

Notes.
1.- This Chapter does not cover:
(a) Straining cloth of human hair (heading 59.11);

HS Code Description:
Ceramic flags and paving, hearth or wall tiles;
ceramic mosaic cubes and the like, whether
or not on a backing; finishing ceramics.

Other bars and rods of stainless steel;
angles, shapes and sections of stainless
steel.

Centrifuges, including centrifugal dryers;
filtering or purifying machinery and
apparatus, for liquids or gases.

Agricultural, horticultural or forestry
machinery for soil preparation or cultivation;
lawn or sportsground rollers.

HS Code:
Notes.
1.- This Chapter does not cover:
(a) Electrically warmed blankets, bed pads, foot-muffs or the like;
electrically warmed clothing, footwear or ear pads or other electrically
warmed articles worn on or about the person;
(b) Articles of glass of heading 70.11;
(c) Machines and apparatus of heading 84.86;
(d) Vacuum apparatus of a kind used in medical, surgical, dental or
veterinary sciences (heading 90.18); or
(e) Electrically heated furniture of Chapter 94.

HS Code Description:
 Following components of motor vehicles;
(1) Head light for vehicles of sub headings
8701.9220 and 8701.9320

Data/graphic display tubes, monochrome;
data/graphic display tubes, colour, with a
phosphor dot screen pitch smaller than 0.4 mm

 Pin for shock absorbers (4x2 vehicles only)
for vehicles of sub headings 8701.2020,
8701.2090, and 8701.9060

Pianos, including automatic pianos;
harpsichords and other keyboard stringed
instruments.

Paint, distemper, varnish or similar brushes
(other than brushes of subheading 9603.30);
paint pads and rollers

Tailors' dummies and other lay figures;
automata and other animated displays used
for shop window dressing.
